import { useState } from "react";

import LoginCard from "../Cards/LoginCard";
import SignUpCard from "../Cards/SignUpCard";
import "./Login.css";



const Login = () => {

    const [login, signUp] = useState(1);

    return (
        <div className="bg">
            {login ? (
                <LoginCard/>
            ):(
                <SignUpCard/>
            )
        }
        <button></button>
        </div>
    )
}

export default Login;
